import React from 'react';

import styles from './DepartmentItem.module.css';


export default ({ appointment_id, start_time, available_resource_id }) => {
	return (
		<li className={styles.row}>
			<div className={styles.text}>
				{appointment_id + '\t' + available_resource_id + '\t' + start_time}
			</div>
		</li>
	);
};
